Alexis Texas, Brooklyn Lee, Diamond Foxxx, Gracie Glam, Lizz Taylor, Teagan Summers


AVN award-winning and Hall of Fame director Miles Long brings you America's premier game show like you've never seen it before - too hot for TV! This XXX version stars Alexis Texas as a model who opens a lot more than just her briefcase! She's part of the 'deal,' along with a hilarious cast of horny contestants that can barely grasp the rules of play (including a surprise cameo by Ron Jeremy!), but end up getting down and dirty with every move - even the Banker gets blown! And just when you thought you'd seen it all, germaphobe Howie himself is forced to do the nasty without a full body condom!
